import React from 'react'
import Posts from './components/Posts'
import Login from './components/Login'

export default props => {

    const [api, setApi] = React.useState('http://localhost:3001')
    const [page, setPage] = React.useState({
        'using': 'default',
        'default': 'Login',
        'pages': {
            'Posts': <Posts api={api} />,
            'Login': <Login />
        }
    })

    return (
        <div className="App">
            <Posts api={api} />
        </div>
    )

}
